import React from "react";
import styled from "styled-components";

const GifBackground = styled.div`
    background-image: url("https://giphy.com/embed/RNlgWpfnRNRGBES99r/video");
    background-size: cover;
    height: 100vh;
    padding: 0;
    margin: 0;
`;

const Gif = styled.div`
    height: "267";
    src: "https://giphy.com/embed/RNlgWpfnRNRGBES99r/video";
    width: "480";
`;

const UserList = () => {
    return (
        <div>
            <div>
                <iframe>
                  <Gif/>
                </iframe>
            </div>
        </div>
    );
};

export default UserList;
